/**
 * Relation Component
 * -------------------------------------
 * Draws a UML-style line from source class to target class.
 */

import React from "react";
import PropTypes from "prop-types";

const Relation = ({
  source,
  target,
  type,
  sourceCardinality,
  targetCardinality,
  classWidth = 200,
  classHeight = 100,
}) => {
  if (!source || !target) return null;

  // Generate unique IDs for markers to prevent conflicts with multiple relations
  const relationId = `relation-${source.x}-${source.y}-${target.x}-${target.y}`;
  const triangleId = `triangle-${relationId}`;
  const diamondHollowId = `diamond-hollow-${relationId}`;
  const diamondFilledId = `diamond-filled-${relationId}`;
  const arrowId = `arrow-${relationId}`;

  // Calculate connection points
  const centerX1 = source.x + classWidth / 2;
  const centerY1 = source.y + classHeight / 2;
  const centerX2 = target.x + classWidth / 2;
  const centerY2 = target.y + classHeight / 2;

  // Calculate the angle and distance
  const dx = centerX2 - centerX1;
  const dy = centerY2 - centerY1;
  const angle = Math.atan2(dy, dx);
  const distance = Math.sqrt(dx * dx + dy * dy);

  // If classes overlap, don't render the relation
  if (distance < 10) return null;

  // Calculate edge points
  const startX = centerX1 + Math.cos(angle) * (classWidth / 2);
  const startY = centerY1 + Math.sin(angle) * (classHeight / 2);
  const endX = centerX2 - Math.cos(angle) * (classWidth / 2);
  const endY = centerY2 - Math.sin(angle) * (classHeight / 2);

  // Calculate midpoint for cardinality
  const midX = (startX + endX) / 2;
  const midY = (startY + endY) / 2;

  return (
    <svg
      style={{
        position: "absolute",
        top: 0,
        left: 0,
        width: "100%",
        height: "100%",
        pointerEvents: "none",
        overflow: "visible",
      }}
    >
      <defs>
        {/* Triangle marker for generalization */}
        <marker
          id={triangleId}
          viewBox="0 0 10 10"
          refX="9"
          refY="5"
          markerWidth="8"
          markerHeight="8"
          orient="auto"
        >
          <path d="M 0 0 L 10 5 L 0 10 z" fill="white" stroke="black" />
        </marker>

        {/* Diamond marker for aggregation */}
        <marker
          id={diamondHollowId}
          viewBox="0 0 12 12"
          refX="12"
          refY="6"
          markerWidth="10"
          markerHeight="10"
          orient="auto"
        >
          <path d="M 0 6 L 6 0 L 12 6 L 6 12 Z" fill="white" stroke="black" />
        </marker>

        {/* Filled diamond marker for composition */}
        <marker
          id={diamondFilledId}
          viewBox="0 0 12 12"
          refX="12"
          refY="6"
          markerWidth="10"
          markerHeight="10"
          orient="auto"
        >
          <path d="M 0 6 L 6 0 L 12 6 L 6 12 Z" fill="black" stroke="black" />
        </marker>

        {/* Arrow marker for dependency */}
        <marker
          id={arrowId}
          viewBox="0 0 10 10"
          refX="9"
          refY="5"
          markerWidth="8"
          markerHeight="8"
          orient="auto"
        >
          <path d="M 0 0 L 10 5 L 0 10" fill="none" stroke="black" />
        </marker>
      </defs>

      {/* Main line */}
      <line
        x1={startX}
        y1={startY}
        x2={endX}
        y2={endY}
        stroke="black"
        strokeWidth="1.5"
        markerStart={
          type === "aggregation"
            ? `url(#${diamondHollowId})`
            : type === "composition"
            ? `url(#${diamondFilledId})`
            : null
        }
        markerEnd={
          type === "generalization"
            ? `url(#${triangleId})`
            : type === "dependency"
            ? `url(#${arrowId})`
            : null
        }
        strokeDasharray={type === "dependency" ? "4,4" : "none"}
      />

      {/* Source Cardinality */}
      {sourceCardinality && (
        <text
          x={startX + (Math.cos(angle) * 20)}
          y={startY + (Math.sin(angle) * 20) - 10}
          textAnchor="middle"
          fill="black"
          fontSize="12"
          fontFamily="Arial"
          style={{ backgroundColor: "white" }}
        >
          {sourceCardinality}
        </text>
      )}

      {/* Target Cardinality */}
      {targetCardinality && (
        <text
          x={endX - (Math.cos(angle) * 20)}
          y={endY - (Math.sin(angle) * 20) - 10}
          textAnchor="middle"
          fill="black"
          fontSize="12"
          fontFamily="Arial"
          style={{ backgroundColor: "white" }}
        >
          {targetCardinality}
        </text>
      )}
    </svg>
  );
};

Relation.propTypes = {
  source: PropTypes.shape({
    x: PropTypes.number,
    y: PropTypes.number,
  }).isRequired,
  target: PropTypes.shape({
    x: PropTypes.number,
    y: PropTypes.number,
  }).isRequired,
  type: PropTypes.oneOf([
    "association",
    "aggregation",
    "composition",
    "generalization",
    "dependency",
  ]).isRequired,
  sourceCardinality: PropTypes.string,
  targetCardinality: PropTypes.string,
  classWidth: PropTypes.number,
  classHeight: PropTypes.number,
};

export default Relation;
